import React, { Component } from 'react';
import './App.css';

class App extends Component {
  constructor(props){
    super(props);
    this.state = {
      Name: "Mohib"
    }
  }

  render(){
    return(
      <h1>Hello world!</h1>
    );
  }
}

export default App;
